import { Col, Container, Row } from "react-bootstrap";

const Banner = () => {
    return (
        <section className = "banner" id = "home">
            <Container>
                <Row className = "align-items-center">
                    <Col xs = {12} md = {6} xl = {7}>
                        <span className="tagline">Welcome to my Portfolio</span>
                        <h1> {"Hi I'm webdecoded"} <span className="wrap">web developer</span> </h1>
                        <p>Hi I am this this this, I do this this this, please insert text, or dont, idk lol man. I'm just tryna live womp womp</p>
                        <button onClick = {() => console.log("let's connect")}>Let's connect</button>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}

export default Banner;
